// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title LinearVesting
 * @dev
 */
contract LinearVesting is Ownable {
    IERC20 token;
    uint256 public start; // quand le vesting commence
    uint256 public cliff; // Priode en seconde
    uint256 public duration; // dure du vesting
    address receiver; // destinataire
    uint256 amount; // nombre de tokkens envoys
    uint256 totalAmount; // montant total des tokens bloqus dans le contract

    //ajouter event

    constructor(address _token, uint256 _duration, uint256 _cliff) {
        require(_duration > 0, "La duree doit etre positive");
        require(
            _duration >= _cliff,
            "cliff ne peut etre superieur a la duree du vesting"
        );
        cliff = _cliff;
        token = IERC20(_token);
        //on initialise pas start dans le constructeur pour s'assurer que la priode de vesting commence aprs que les tokens verouills
        duration = _duration;
    }

    /**
     * @dev imobiliser tokkens a periode determine
     * @param _from description from
     * @param _receiver description receiver
     */
    function lock(
        address _from,
        address _receiver,
        uint256 _amount
    ) public onlyOwner {
        // Vrifier que le montant  verrouiller est positif
        require(_amount > 0, "Le montant a verrouiller doit etre positif");

        require(totalAmount == 0, "Already locked"); // peut etre verrouill qu'une seule fois

        token.transferFrom(_from, address(this), _amount); //transfrer les tokens du propritaire original (_from) vers le contrat de vesting (address(this)).

        receiver = _receiver;
        amount = _amount;
        start = block.timestamp;
        totalAmount = _amount;
    }

    //Pas de paramtres
    /**
     * @dev libration linaire des tokens selon letemps fix
     *
     *
     */
    function release() external {
        require(block.timestamp >= start, "Vesting n'est pas commence");
        require(
            block.timestamp >= start + cliff,
            "Avant le cliff rien ne peut etre retire"
        ); //le dlai de vesting a commenc.
        require(
            msg.sender == receiver || msg.sender == owner(),
            "Vous n'etes pas autorise a liberer les tokens"
        );
        // calculer le pourcentage de temps depuis le debut du vesting
        uint256 pourcentageTime = start - block.timestamp / duration;

        //Calculer combien de tokens sont disponibles pour tre librs en fonction du temps coul depuis le dbut du vesting.

        //Transfrer ces tokens au bnficiaire.

        token.transfer(receiver, amount);
    }
}

